    <style>
        * {
            box-sizing: border-box;
        }
        html {
            background-color: #000000;
        }

        body {
            color: #ffffff;
            width: 100%;
            font-family: 'Poppins', sans-serif;
            font-size: 1.5vw;
            margin: 0;
        }

        #panel {
            background-color: #1e1e1e;
            border: 3px solid #c2c6c9;
            border-radius: 1.5rem;
            padding: 2.5vh;
            min-width: 40%;
            max-height: 85vh;
            margin: 7.5vh;
            display: flex;
            flex-direction: column;
            position: relative;
            height: 100%;
        }

        @media (max-width: 450px) {
            h1 {
                margin-top: 25%;
                font-size: 2rem !important;
            }
            #logo {
                max-width: 100% !important;
            }
            #slash {
                display: none;
            }
        }

        h1 {
            font-size: 3vw;
            font-weight: bold;
            margin-top: 0.5rem;
            margin-bottom: 0.5rem;
        }

        h2 {
            font-weight: 300;
        }

        h3 {
            font-weight: 200;
        }

        a {
            color: white;
            text-decoration: underline;
        }

        #logo {
            position: absolute;
            width: 13vw;
            top: 3%;
            right: 2%;
        }
        #slash {
            color: #ff4dc9;
        }
        #question-diagram {
            margin-right: 16px;
        }
        #diagram-container {
            margin-top: calc(1.5rem);
            display: flex;
            justify-content: center;
            flex-grow: 1;
            overflow: auto;
        }
    </style>
